import bootstrap from "bootstrap";import { Outlet, NavLink } from "react-router-dom";

export const ROUTES = {
  CONTACTS: "/contacts",
  APPOINTMENTS: "/appointments",
};

function Root() {
  return (
    <>
      <nav className="navbar mb-3">
        <NavLink to={ROUTES.CONTACTS}>Contacts</NavLink>
        <NavLink to={ROUTES.APPOINTMENTS}>Appointments</NavLink>
      </nav>
      <Outlet />
    </>
  );
}

export default Root;
